FEMALE ABDOMEN (
Fig. 10
). Tergite 7 with posterior margin entire. Medial part of tergite 8 elongate, narrower anteriorly, posteriorly closely approximated with epiproct. Epiproct tulip-shaped, heavily sclerotized; longitudinally lightly sclerotized on apical half. Cercus strap-like, length ~0.5× epiproct. Sternite 7 wider than sternite 6; posterior margin with broad, shallow emargination. Spermathecae bilobed, constricted near midlength; distal portion cup-shaped, basal portion ovoid and narrowed before duct junction; spermatheca stem as long as spermathecal width.
